import React from 'react'
import QuickSearchDisplay from './QuickSearchDisplay'

const QuickSearch =() => {
    return(
        <div className="container mt-5 pl-sm-5" >
            <h1 class="quick">Quick Searches</h1>
            <h4 class="quick discover">Discover restaurant by type of meal</h4>
            <QuickSearchDisplay/>
        </div>
    )
}

export default QuickSearch
